import React from "react";
import ReactDOM from "react-dom";
import dummyContacts from "./dummyData";

const Main = () => {
  return (
    <div id="main">
      <div id="navbar">
        <div>Contact List</div>
      </div>
      <div id="container">
        <table>
          <tbody>
            <tr>
              <th>Name</th>
              <th>Phone</th>
              <th>Email</th>
            </tr>
            {contacts.map((contacts) => {
              return (
                <tr>
                  <td>{contact.name}</td>
                  <td>{contact.phone}</td>
                  <td>{contact.email}</td>
                </tr>
              );
            })}
          </tbody>
        </table>
      </div>
    </div>
  );
};

ReactDOM.render(<Main />, document.getElementById("app"));
